import React from 'react';
import Cardimg from '../components/images/7.jpg'

export default function Card() {
    return (
        <section className='card-container'>
            < img src={Cardimg} />
            <div>
                <img />
                <p>Life lessons with Jayden</p>
            </div>
            <h3><span>From $136</span> / person</h3>
        </section>
    )
}
